// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract AttendanceLedger {

  struct Student {
    string studentId;
    string firstName;
    string lastName;
    string email;
    string department;
    uint year;
    string section;
    string password;
    bool isActive;
  }

  mapping(string => Student) public students;
  string[] public studentIds;

  function registerStudent(string memory studentId, string memory firstName, string memory lastName, string memory email, string memory department, uint year, string memory section, string memory password) public {
    require(students[studentId].isActive == false, "Student already registered");
    studentIds.push(studentId);
    students[studentId] = Student(studentId, firstName, lastName, email, department, year, section, password,true);
  }

  function getStudent(string memory studentId) public view returns (Student memory) {
    return students[studentId];
  }

  function getStudentIds() public view returns (string[] memory) {
    return studentIds;
  }

  function loginStudent(string memory studentId, string memory password) public view returns (bool) {
    return keccak256(abi.encodePacked(students[studentId].password)) == keccak256(abi.encodePacked(password));
  }
}
